import React, { useEffect } from 'react';
// import Prism from 'prismjs';

// import 'prismjs/themes/prism.css'; // Prism 테마 추가
// import 'prismjs/components/prism-javascript'; // 사용할 언어 추가

export default function Position() {
  
 
    // useEffect(() => {
    //   Prism.highlightAll(); // Prism을 사용하여 코드 하이라이팅 적용
    // }, []); // useEffect를 사용하여 컴포넌트가 마운트될 때만 실행

    const PrismCode = styled.code`
  font-family: Consolas, Monaco, 'Andale Mono', 'Ubuntu Mono', monospace;
  font-size: 12px;
  text-align: left;
  white-space: pre;
  word-spacing: normal;
  word-break: normal;
  word-wrap: normal;
  line-height: 1.5;
  -moz-tab-size: 4;
  -o-tab-size: 4;
  tab-size: 4;
  -webkit-hyphens: none;
  -moz-hyphens: none;
  -ms-hyphens: none;
  hyphens: none;
  
  /* 특정 토큰에 대한 스타일 */
  .token.comment {
    color: #5c6370;
  }

  .token.function {
    color: #61afef;
  }
`;

const StyledPre = styled.pre`
  background: #282c34; /* 기존 pre 배경색으로 변경 */
  margin: 0;
  padding: 16px;
  overflow: auto;
  font-size: 16px;
  border-radius: 5px;
  width: 642px;
`;
  
    return (
      <StyledPre>
        <PrismCode className="language-javascript">
          {`
            function 슬라이드위치업데이트(){
              menuContainerUl.style.transform = \`translateX(-\${100 * index}vw)\`
            }
          
            function 차움직이기(도착지점){
              console.log(neneCar)
              neneCar.style.left= \`\${도착지점}%\`;
          
                if(네네카이전좌표 < 도착지점) {
                  neneCar.setAttribute('src',"./nene/img/rightnenecar.png")
                }else {
                  neneCar.setAttribute('src',"./nene/img/leftnenecar.png")
                }
          
                setTimeout(() => {
                  neneCar.setAttribute('src',"./nene/img/네네캐릭터.png")
                }, 1000);
                네네카이전좌표=도착지점;
            }
          
            let slideState = true;
          
            function slideControl() {
              if(slideState) {
                slideState === false;
                slideState === true;
              }
            }
          `}
        </PrismCode>
      </StyledPre>
    );
  };
